pi-v3\/embed\/js\/54\/6\/init_embed.js","line":303,"type":"source-location","urlProvider":"network"}}],"instructions":"<p>Add a passive flag to every event listener that Lighthouse identified.<\/p>\n\t\t\t\t\t\t<p>If you&#039;re only supporting browsers that have passive event listener support, just add the flag.<\/p>\n\t\t\t\t\t\t<p>For example:<\/p>\n\t\t\t\t\t\t<code>document.addEventListener(&quot;touchstart&quot;, onTouchStart, {passive: true});<\/code>\n\t\t\t\t\t\t<p>If you&#039;re supporting older browsers that don&#039;t support passive event listeners, you&#039;ll need to use feature detection or a polyfill. See the Feature Detection section of the WICG Passive event listeners explainer document for more information.<\/p>"},"no-document-write":{"title":"Avoids `document.write()`","description":"For users on slow connections, external scripts dynamically injected via `document.write()` can delay page load by tens of seconds. [Learn how to avoid document.write()](https:\/\/developer.chrome.com\/docs\/lighthouse\/best-practices\/no-document-write\/).","score":1,"displayValue":null,"details":[],"instructions":"<p>You can fix this audit by preferably eliminating document.write() altogether, wherever possible.<\/p>\n\t\t\t\t\t\t<p>Avoiding the use of document.write() should ideally be built into your development workflow so that your production website is optimized for web performance from the beginning.<\/p>\n\t\t\t\t\t\t<p>Using W3 Total Cache JS Minify and deferring or using async may also help.<\/p>"},"non-composited-animations":{"title":"Avoid non-composited animations","description":"Animations which are not composited can be janky and increase CLS. [Learn how to avoid non-composited animations](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/non-composited-animations\/)","score":null,"displayValue":"3 animated elements found","details":[{"subItems":{"items":[{"failureReason":"Unsupported CSS Property: box-shadow","animation":"button-ripple"