>"},"uses-long-cache-ttl":{"title":"Serve static assets with an efficient cache policy","description":"A long cache lifetime can speed up repeat visits to your page. [Learn more about efficient cache policies](https:\/\/developer.chrome.com\/docs\/lighthouse\/performance\/uses-long-cache-ttl\/).","score":0.68000000000000004884981308350688777863979339599609375,"displayValue":"2 resources found","details":[{"cacheLifetimeMs":1800000,"wastedBytes":54078.75,"debugData":{"max-age":1800,"type":"debugdata","public":true},"cacheHitProbability":0.137500000000000011102230246251565404236316680908203125,"url":"https:\/\/maps.googleapis.com\/maps\/api\/js?client=google-maps-embed&paint_origin=&libraries=geometry,search&v=3.exp&language=en_US&callback=onApiLoad","totalBytes":62700},{"debugData":{"type":"debugdata","public":true,"max-age":86400},"totalBytes":49949,"cacheLifetimeMs":86400000,"cacheHitProbability":0.59999999999999997779553950749686919152736663818359375,"wastedBytes":19979.60000000000218278728425502777099609375,"url":"https:\/\/maps.googleapis.com\/maps\/api\/js\/StaticMapService.GetMapImage?1m2&1i3093663&2i4761564&2e1&3u15&4m2&1u635&2u424&5m5&1e0&5sen-US&6sus&10b1&12b1&client=google-maps-embed&token=111147"}],"instructions":"<p>Use <a target=\"_blank\" href=\"https:\/\/ctblackeagle.com.br\/wp-admin\/admin.php?page=w3tc_general#browser_cache\" alt=\"Browser Cache\">Browser Caching<\/a> in W3 Total Cache and set the Expires header and cache control header for static files and HTML.<\/p>\n\t\t\t\t\t\t<p>Use default values for best results<\/p>"},"critical-request-chains":{"title":"Avoid chaining critical requests","description":"The Critical Request Chains below show you what resources are loaded with a high priority. Consider reducing the length of chains, reducing the download size of resources, or deferring the download of unnecessary resources to improve page load. [Learn how to avoid chaining critical requests](https:\/\/developer.chrome.com\/docs\/lighthouse\/per